ats.moe, 6) + "</li>" +            "<li>The standard error of the mean: " + fixNumber(routeData.stats.sem, 6) + "</li>" +            "<li>The sample variance: " + fixNumber(routeData.stats.variance, 6) + "</li>" +            "</ul><ul><li>75% Percentile: " + fixNumber(routeData.stats.p75, 6) + "</li>" +            "<li>95% Percentile: " + fixNumber(routeData.stats.p95, 6) + "</li>" +            "<li>99% Percentile: " + fixNumber(routeData.stats.p99, 6) + "</li>" +            "<li>99.9% Percentile: " + fixNumber(routeData.stats.p999, 6) + "</li>" +            "</ul></div></div><div class=\"request panel hide\">Request: " + routeData.options.method.toUpperCase() +             " <a href=\"" + routeData.href + "\" target=\"_blank\">" +             routeData.href + "</a><br />Concurrency level: " + routeData.options.concurrencyLevel + "<br />";          if(routeData.options.delay)            template += "Delay between bench cycles: " + routeData.options.delay + "<br />";          var requestHeaders = "none",              requestData = "none";          if(!!routeData.request.headers)            requestHeaders = "<br /><pre><code>" + JSON.stringify(routeData.request.headers, undefined, 2) + "</pre></code>";          if(!!routeData.request.data)            requestData = "<br /><pre><code>" + JSON.stringify(routeData.request.data, undefined, 2) + "</pre></code>";          template += "<br />Headers sent: " + requestHeaders + "<br />Data sent: " + requestData + "<br /></div><div class=\"response panel hide\">Data here refers to the first sampled response.<br /><br />";          var responseHeader = JSON.stringify(routeData.response.header, undefined, 2),              responseBody = "";          try {            responseBody = JSON.stringify(JSON.parse(routeData.response.body), undefined, 2);          } catch(e){            responseBody = routeData.response.body;          }          template += "Response status: " + routeData.response.statusCode + "<br />Response headers:<br />" +            "<pre><code>" + responseHeader + "</code></pre>" +            "<br />Response body:<br /><pre><code>" + responseBody + "</code></pre><br /></div></div>";          return template;        }      };      var bindButtons = function(){        var bindButton = function(panelName){          $(selectors.buttons[panelName]).click(function(){            var $sender = $(this),                $panelsContainer = $sender.parent().parent();            $panelsContainer.find(selectors.button).removeClass("selected");            $sender.addClass("selected");            $panelsContainer.find(selectors.panel).addClass("hide");            $panelsContainer.find(selectors.panels[panelName]).removeClass("hide");            return false;          });        };        bindButton('stats');        bindButton('response');        bindButton('request');      };      $(function(){        $(selectors.reportDetails).append(templates.reportDetails(data.info));        var counter = 0;        for(serviceName in data.benchmark){          for(routeName in data.benchmark[serviceName]){            $(selectors.charts).append(templates.route(data.benchmark[serviceName][routeName], counter));            var samples = data.benchmark[serviceName][routeName]['stats']['sample'],                meanArray = [],                mean = data.benchmark[serviceName][routeName]['stats']['mean'],                singleMeanArray = [],                singleMean = data.benchmark[serviceName][routeName]['stats']['singleMean'],                maxMeanArray = [],                maxMean = data.benchmark[serviceName][routeName].options.maxMean !== undefined,                maxSingleMeanArray = [],                maxSingleMean = data.benchmark[serviceName][routeName].options.maxSingleMean !== undefined,                errorsArray = [],                areThereSomeErrors = false;            for(var i = 0; i < samples.length; i++){              meanArray.push(mean);              singleMeanArray.push(singleMean);              errorsArray.push(null);              if(maxMean)                maxMeanArray.push(data.benchmark[serviceName][routeName].options.maxMean);              if(maxSingleMean)                maxSingleMeanArray.push(data.benchmark[serviceName][routeName].options.maxSingleMean);            }            for(var errorType in data.benchmark[serviceName][routeName].errors){              var errorsOfType = data.benchmark[serviceName][routeName]['errors'][errorType];              for(var i = 0; i < errorsOfType.length; i++){                if(errorsOfType[i].pos !== undefined){                  errorsArray[errorsOfType[i].pos] = data.benchmark[serviceName][routeName]['stats']['sample'][errorsOfType[i].pos];                  areThereSomeErrors = true;                }              }            }            var getSeriesOptions = function(label, color){              return {                showMarker: false,                pointLabels: { show: true },                label: label,                color: color              };            };            var lines = [samples],                series = [getSeriesOptions('Samples', '#6699FF')];            if(maxMean){              lines.push(maxMeanArray);              series.push(getSeriesOptions('Max Mean', '#F90'));            }            lines.push(meanArray);            series.push(getSeriesOptions('Mean', '#66FF00'));            if(maxSingleMean){              lines.push(maxSingleMeanArray);              series.push(getSeriesOptions('Max Single Mean (*)', '#EBFF00'));              lines.push(singleMeanArray);              series.push(getSeriesOptions('Single mean', '#FC6333'));            }            if(areThereSomeErrors > 0){              lines.push(errorsArray);              series.push({                showLine:false,                markerOptions: { size: 7, style:"x" },                label: 'Errors',                color: '#FF0000'              });            }            var options = {              title: {                text: data.benchmark[serviceName][routeName]['name'],                color: '#F1F1F1'              },              animate: true,              grid: {                background: '#000000', textColor: '#F1F1F1'              },              seriesDefaults:{                rendererOptions: {                  showDataLabels: true                }              },              highlighter: {                show: true,                sizeAdjust: 7.5              },              legend: {                show:true,                location: 'se',                background: 'rgba(101, 0, 253, 0.89)'              },              axesDefaults: {                labelRenderer: $.jqplot.CanvasAxisLabelRenderer              },              axes: {                xaxis: {                  label: "Samples",                  pad: 0                },                yaxis: {                  label: "Response time (seconds)",                  tickOptions: {                    formatString:'%.6f'                  }                }              },              series: series            };            var plot = $.jqplot('chart' + counter, lines, options);            counter++;          }        }        hljs.initHighlightingOnLoad();        bindButtons();      });    </script>  </body></html>
